import { useEffect } from "react";

function ErrorPage() {

    useEffect(() => {
        document.title = '404';
    }, []);

    return (
        <div class="container text-center">
            <span class="number">4</span>
            <div class="circle"></div>
            <span class="number">4</span>
        </div>
    )
}

export default ErrorPage;
